import React from 'react';

import Table from 'react-bootstrap/Table'
function StockTable(props){
    //console.log(props, 'yeet');
    console.log(props.latestStock.date);
    const stock=props.latestStock;
    
    return (
        <div className="stock__table">
            <h1>does this work?</h1>

            <Table striped >
                <thead>
                    <tr>
                        {/* <th>Date</th>     */}
                        <th>Open</th>    
                        <th>High</th>    
                        <th>Low</th>    
                        <th>Close</th>    
                        <th>Volume</th>    
                    </tr>
                    </thead>    
                    <tbody>
                        <tr>
                            {/* <td>{props.date}</td> */}
                            <td>{stock.open}</td>
                            <td>{stock.high}</td>
                            <td>{stock.low}</td>
                            <td>{stock.close}</td>
                            <td>{stock.volume}</td>
                        </tr>
                    </tbody>
                
                
            </Table>    






        </div>
        
    );


}

export default StockTable;
